import React, {Component} from "react";

class Header extends Component {
    constructor(props){
        super(props);
    }
    render() {
        return (
            <div class="ts large link attached inverted info menu">
                <div id="mynavbar" class="ts container">
                    <div class="ts center aligned four column grid">
                        <div class="column">置中的文字</div>
                        <div class="left aligned two column row">
                            <div class="column">置左的文字</div>
                            <div class="right aligned column">置右的文字</div>
                        </div>
                    </div>
                    <div class="ts twelve column grid">
                        <div class="eight column">
                            <div id="sproutheader" class="left floated column">Sprout Farm</div>
                            <div class="right floated column">{this.props.current_time}</div>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}

export default Header
